import React from "react";
import { Outlet, Link } from "react-router-dom";
import '../Styles/Header.css'
function Header(){

    return(
        <>
        <header>
            <a><Link to="/">Observatorio  Online</Link></a>
            <div className="HbarraPesquiza">
            </div>
            <a><Link to="">Sobre</Link></a>
            <a><Link to="cadastro">Cadastrar</Link></a>
            <a><Link to="">Login</Link></a>
            
        </header>
        
        <Outlet/>
        </>
    )
}

export default Header
